import './Concepts.css';

import Card from '../card/Card';

const Concepts = (props) => {
	return (
		<Card className="concept">
			<img src={props.image} alt={props.description} />
			<h2>{props.title}</h2>
			<p>{props.description}</p>
		</Card>
	);
};

export default Concepts;
